import React from "react";
import ibrahim from "../assets/images/ibrahim.png";
import ahmad from "../assets/images/ahmad.png";
import logo from "../assets/images/logo.png";
import "../css/about.css";

const AboutUs = () => {
    return (
        <div class="doctors-container">
  <div class="doctor-card">
    <img src={ibrahim} alt="Dr. Ibrahim" />
    <div>
      <h3>Dr. Ibrahim</h3>
      <p>Specializes in Cardiology</p>
      <p>Dr. Ibrahim is an experienced cardiologist with over 10 years of experience. He is passionate about providing personalized care to his patients and believes in treating the whole person, not just their condition.</p>
    </div>
  </div>
  <div class="doctor-card">
    <img src={ahmad} alt="Dr. Ahmad" />
    <div>
      <h3>Dr. Ahmad</h3>
      <p>Specializes in Pediatrics</p>
      <p>Dr. Ahmad is a board-certified pediatrician with over 15 years of experience. He is committed to providing comprehensive care to his patients, from infancy through adolescence.</p>
    </div>
  </div>
</div>

    );
};

export default AboutUs;
